sourcesContent:
import Airlines from '../../../models/airlines';
import Airports from '../../../models/airports';
import Employees from '../../../models/employee';
import Flights from '../../../models/flights';
import Tickets from '../../../models/tickets';

function AdministratorRoute(server) {
  server.route([
    {
      method: 'GET',
      path: '/admin/test',
      handler: async (request, reply) => {
        return '<h1> admin working! </h1>';
      }
    },

    //-------------------------------------------------//
    //---------------------Reports---------------------//
    //-------------------------------------------------//

    // 1. -- total profit of flights -- //
    {
      method: 'GET',
      path: '/admin/totalProfitFlights',
      handler: async (request, reply) => {
        try {
          const result = await Flights.aggregate([
            {
              $group: {
                _id: {
                  airline: '$airline_id',
                  ticketsSold: '$ticketsSold',
                  capacityPlane: '$capacityPlane',
                  profit: {
                    $sum: {
                      $multiply: ['$price', '$ticketsSold']
                    }
                  }
                }
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 2. -- range of tickets bought by passenger -- //
    {
      method: 'GET',
      path: '/admin/rangeTicketsPassengers/{id}',
      handler: async (request, reply) => {
        try {
          const passengerId = parseInt(request.params.id);
          const result = await Tickets.aggregate([
            {
              $match: {
                passenger_id: passengerId
              }
            },
            {
              $group: {
                _id: '$passenger_id',
                minQuantity: { $min: '$amount' },
                maxQuantity: { $max: '$amount' }
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 3. -- most visited destinations -- //
    {
      method: 'GET',
      path: '/admin/mostVisited/',
      handler: async (request, reply) => {
        try {
          const result = await Flights.aggregate([
            {
              $group: {
                _id: '$destination',
                maxQuantity: { $max: '$ticketsSold' }
              }
            },
            {
              $limit: 3
            },
            {
              $sort: { maxQuantity: -1 }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 4.1 -- total amount of ticket per passengers general -- //
    {
      method: 'GET',
      path: '/admin/ticketsPassengers/{id}',
      handler: async (request, reply) => {
        try {
          const passengerId = parseInt(request.params.id);
          const result = await Tickets.aggregate([
            {
              $match: {
                passenger_id: passengerId
              }
            },
            {
              $group: {
                _id: '$passengerId',
                totalTickets: {
                  $sum: '$amount'
                }
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 4.2 -- total amount of ticket per passengers by dates -- //
    {
      method: 'GET',
      path: '/admin/ticketsPassengerDates/{date}',
      handler: async (request, reply) => {
        try {
          const date = request.params.date;
          const result = await Tickets.aggregate([
            {
              $match: {
                dateBought: date
              }
            },
            {
              $group: {
                _id: '$passengerId',
                totalTickets: {
                  $sum: '$amount'
                }
              }
            }
          ]);
          return date;
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 4.3 -- total amount of ticket per passengers by state -- //
    {
      method: 'GET',
      path: '/admin/ticketsPassengerState/',
      handler: async (request, reply) => {
        try {
          const { passengerId, state } = request.payload;
          const result = await Tickets.aggregate([
            {
              $match: {
                passenger_id: parseInt(passengerId),
                used: state
              }
            },
            {
              $group: {
                _id: null,
                totalTickets: {
                  $sum: '$amount'
                }
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 4.4 -- total amount of ticket per passengers by id, dates, state -- //
    {
      method: 'POST',
      path: '/admin/searchingTickets/',
      handler: async (request, reply) => {
        try {
          const { passengerId, boarded, date1, date2 } = request.payload;
          const result = await Tickets.aggregate([
            {
              $match: {
                passenger_id: parseInt(passengerId),
                boarded: boarded,
                dateBought: {
                  $gte: date1,
                  $lt: date2
                }
              }
            },
            {
              $group: {
                _id: '$passenger_id',
                totalTickets: {
                  $sum: '$amount'
                }
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 4.5 -- top three passangers with most flights -- //
    {
      method: 'GET',
      path: '/admin/topThreePassengers/',
      handler: async (request, reply) => {
        try {
          const result = await Tickets.aggregate([
            {
              $group: {
                _id: '$passenger_id',
                maxQuantity: { $max: '$amount' }
              }
            },
            {
              $limit: 3
            }
          ]);

          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    //-------------------------------------------------//
    //------------------CRUD Airports------------------//
    //-------------------------------------------------//

    // -- new airport --//
    {
      method: 'POST',
      path: '/admin/newAirport/',
      handler: async (request, reply) => {
        try {
          const newAirports = new Airports(request.payload);
          const result = await newAirports.save();
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // -- edit airport by id --//
    {
      method: 'PUT',
      path: '/admin/updateAirport/{id}',
      handler: async (request, reply) => {
        try {
          const result = await Airports.findByIdAndUpdate(
            request.params.id,
            request.payload,
            { new: true }
          );
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // -- find airport all and by id --//
    {
      method: 'GET',
      path: '/admin/findAllAirports/',
      handler: async (request, reply) => {
        try {
          const result = await Airports.find();
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },
    {
      method: 'GET',
      path: '/admin/findAirportsId/{id}',
      handler: async (request, reply) => {
        try {
          const airportId = request.params.id;
          const result = await Airports.findById(airportId);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // -- remove airport by id --//
    {
      method: 'DELETE',
      path: '/admin/deleteAirports/{id}',
      handler: async (request, reply) => {
        try {
          const airportsId = request.params.id;
