import Flights from '../../../models/flights';
import Passengers from '../../../models/passenger';
import Tickets from '../../../models/tickets';

function EmployeesRoutes(server) {
  server.route([
    {
      method: 'GET',
      path: '/employee/test',
      handler: async (request, reply) => {
        return '<h1> employees working! </h1>';
      }
    },

    //-------------------------------------------------//
    //---------------------Reports---------------------//
    //-------------------------------------------------//

    // 1. -- verify check-in -- //
    {
      method: 'POST',
      path: '/employee/checkIn/',
      handler: async (request, reply) => {
        try {
          const query = {
            ticketId: request.payload.ticketId,
            passengerId: request.payload.passengerId
          };
          const result = await Tickets.find(
            {
              _id: query.ticketId,
              passenger_id: parseInt(query.passengerId)
            },
            {
              checked: 1
            }
          );
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    // 2. -- passengers info: all and by id --//
    {
      method: 'GET',
      path: '/employee/passengerInfo/',
      handler: async (request, reply) => {
        try {
          const result = await Passengers.aggregate([
            {
              $lookup: {
                from: 'tickets',
                localField: '_id',
                foreignField: 'passenger_id',
                as: 'ticketsInfo'
              }
            }
          ]);
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
        }
      }
    },

    {
      method: 'GET',
