      handler: async (request, reply) => {
        try {
          const { _id, passenger_id } = request.payload;
          const result = await Tickets.update(
            {
              _id: _id,
              passenger_id: passenger_id
            },
            {
              $set: {
                boarded: true
              }
            }
          );
          return reply.response(result);
        } catch (error) {
          return reply.response(error).code(500);
